func testVolumeToManyAddOpVolumeAccesses(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Volume
	var b, c, d, e VolumeAccess

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, volumeDBTypes, false, strmangle.SetComplement(volumePrimaryKeyColumns, volumeColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*VolumeAccess{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, volumeAccessDBTypes, false, strmangle.SetComplement(volumeAccessPrimaryKeyColumns, volumeAccessColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(tx); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*VolumeAccess{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddVolumeAccesses(tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if a.ID != first.Volume {
			t.Error("foreign key was wrong value", a.ID, first.Volume)
		}
		if a.ID != second.Volume {
			t.Error("foreign key was wrong value", a.ID, second.Volume)
		}

		if first.R.Volume != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Volume != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.VolumeAccesses[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.VolumeAccesses[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.VolumeAccessesByFk(tx).Count()
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}
